import React from "react";
import { connect } from "react-redux";
import "../Style/ScoreTable.css";
function ScoreTable({ user, score }) {
  return (
    <div className="score_table">
      <div className="score_table__info">Rock Paper Scissors</div>
      <div className="score_table__score">Score: {score}</div>
    </div>
  );
}

const mapStateToProps = (state) => {
  return {
    user: state.user,
    score: state.score,
  };
};

export default connect(mapStateToProps)(ScoreTable);
